import React from 'react'
import './NavBar.scss';

function NavBar() {
  return (
  <>
   <h1>como</h1>
    <ul className="listItems">
        <li>
            <link to="/">Accueil</link>
        </li>
        <li>
            <link to="/Ecrire">Ecrire</link>
        </li>
        <li>
            <link to="/Contact">Contact</link>
        </li>
    </ul>
  </>
  );
}

export default NavBar;
